rulesList.cssText:
.ekgjut::-webkit-slider-thumb { border-radius: var(--border-radius-rounded); box-shadow: var(--shadow-elevation-1); width: var(--range-thumb-size); height: var(--range-thumb-size); margin-block-start: calc(
    var(--range-size) / 2 -
      var(--range-thumb-size) / 2
  ); border: var(--border-width-default) solid var(--color-border-range-handle); background-color: var(--color-background-range-fill); appearance: none; }

@-webkit-keyframes dvEfcS { 
  0%, 20%, 40%, 60%, 80%, 100% { animation-timing-function: cubic-bezier(0.215, 0.61, 0.355, 1); }
  0% { transform: scale3d(0.3, 0.3, 0.3); opacity: 0; }
  60% { transform: scale3d(1.1, 1.1, 1.1); }
  100% { transform: scale3d(1, 1, 1); opacity: 1; }
}

@keyframes dvEfcS { 
  0%, 20%, 40%, 60%, 80%, 100% { animation-timing-function: cubic-bezier(0.215, 0.61, 0.355, 1); }
  0% { transform: scale3d(0.3, 0.3, 0.3); opacity: 0; }
  60% { transform: scale3d(1.1, 1.1, 1.1); }
  100% { transform: scale3d(1, 1, 1); opacity: 1; }
}

@keyframes audio-wave-pulse { 
  0% { transform: scaleY(1); transform-origin: 50% 50%; }
  50% { transform: scaleY(0.7); transform-origin: 50% 50%; }
  100% { transform: scaleY(1); transform-origin: 50% 50%; }
}

@media (min-width: 1024px) {
  .cheermote-for-amount__cheer-image { height: 70px; width: auto; }
  .cheermote-for-amount__cheer-image--small { height: 35px; width: auto; }
  .cheermote-for-amount__cheer-image--extra-small { height: 25px; width: auto; }
  .cheermote-for-amount__cheer-image--extremely-small { height: 13px; width: auto; }
  .cheermote-for-amount__cheer-amount { font-size: var(--font-size-2); }
  .cheermote-for-amount__cheer-amount--medium, .cheermote-for-amount__cheer-amount--small { font-size: var(--font-size-4); }
  .cheermote-for-amount__cheer-amount--extremely-small { font-size: var(--font-size-5); }
}
